var ConfigHelper = _.Class({
    initialize: function() {},
    base: function() {
        return "https://app.gistboxapp.com";
    },
    newGistFrameUrl: function() {
        return this.base() + "/clipper/enter";
    }
});
var GitHubGistMenu = _.Class({
    initialize: function() {
        // todo: remove once implemented
        return;

        // do not show in gistbox
        if (window.location.href.indexOf("app.gistboxapp.com") > -1)
            return;

        // only care about gist.github
        if (window.location.href.indexOf("gist.github.com") === -1)
            return;

        var self = this;

        self.initializeSaveMenu();

        setInterval(function() {
            self.initializeSaveMenu();
        }, 1000);

    },
    initializeSaveMenu: function() {
        var $forkButton = $("button.fork-button:visible");

        if ($forkButton.length > 0 && $forkButton.attr("data-gistbox-initialized") == null) {
            $forkButton.attr("data-gistbox-initialized", true);

            var $saveMenu = this.insertSaveMenu($forkButton);
            this.wireSaveMenu($saveMenu);
        }
    },
    insertSaveMenu: function($forkButton) {
        var $pageHeadActions = $forkButton.closest("ul.pagehead-actions");
        $pageHeadActions.find("li:first").after(Handlebars.templates.githubSaveButtonView());
    },
    wireSaveMenu: function($saveMenu) {

    }
});
var NewGistFrame = _.Class({
    initialize: function() {
        var $body = $("body");

        if ($body.attr("data-gistbox-initialized") == null) {
            $body.attr("data-gistbox-initialized", true);

            // we need a hidden form to post to the iframe
            $body.append('<form id="gclp-frame-form" target="gclp-frame" method="post" style="display: none;"></form>');

            this.wireOnMessage();
        }
    },
    postToFrame: function(args) {
        var self = this;
        var $form = $("#gclp-frame-form");

        $form.attr("action", app.configHelper.newGistFrameUrl());

        // args are in the form { name: '', value: '' }
        $.each(args, function(i, arg) {
            $form.append('<input type="hidden" name="' + arg.name + '" value="' + encodeURIComponent(arg.value) + '" />');
        });

        $form.submit();

        // cleanup
        $form.find("input[type='hidden']").remove();

        setTimeout(function() {
            // delay for page to load
            self.injectCommandWatcher();
        }, 2000);
    },
    injectCommandWatcher: function() {
        // iframe content script watcher
        chrome.runtime.sendMessage({
            action: "inject:commandWatcher"
        });
    },
    start: function(args) {
        $.fancybox('<iframe name="gclp-frame" class="gclp-frame"></iframe>', {
            width: 760,
            height: 610,
            padding: 0,
            margin: 0,
            autoSize: false,
            helpers: {
                overlay: {
                    closeClick: false
                }
            }
        });

        this.postToFrame([
            { name: "description", value: this.gistDescription(args.url) },
            { name: "content", value: args.content }
        ]);
    },
    close: function() {
        $.fancybox.close();
    },
    wireOnMessage: function() {
        // handle requests from the context menu
        var self = this;

        chrome.runtime.onMessage.addListener(function(request, sender, callback) {
            if (request.id === "contextMenu:createGist" || request.id === "contextMenu:saveAsGist") {
                self.start(request.data);
            } else if (request.id === "newGist:close") {
                self.close();
            }
        });
    },
    gistDescription: function(url) {
        return "From " + url
    }
});
var PageCodeGrabber = _.Class({
    codeBlockIndex: 0,
    initialize: function() {
        // do not show in gistbox
        if (window.location.href.indexOf("app.gistboxapp.com") > -1)
            return;

        // do not show on github
        if (window.location.href.indexOf("github.com") > -1)
            return;

        var self = this;
        self.wireCodeBlocks();

        setInterval(function() {
            // for ajax-y applications
            self.wireCodeBlocks();
        }, 1000);
    },
    wireCodeBlocks: function() {
        this.wireGrabCode(this.codeBlocks());
    },
    codeBlocks: function() {
        var self = this;
        var blocks = [];

        var $pre = $("pre");

        // make sure we have the inner-most block
        $pre.each(function() {
            if ($(this).attr("data-initialized"))
                return;

            $(this).attr("data-initialized", true);

            if (self.isBlock($(this)))
                blocks.push($(this));
        });

        return blocks;
    },
    wireGrabCode: function(codeBlocks) {
        var self = this;
        var $body = $("body");

        $.each(codeBlocks, function(i, $block) {
            var $codeGrabber = $('<div class="gclp-code-grabber"></div>');

            self.positionCodeGrabber($block, $codeGrabber);

            $(window).resize(function() {
                self.positionCodeGrabber($block, $codeGrabber);
            });

            // we can referenced the attached $block
            $codeGrabber.attr("data-gclp-id", self.codeBlockIndex);
            $block.attr("data-gclp-id", self.codeBlockIndex);
            self.codeBlockIndex++;

            $body.append($codeGrabber);
            $codeGrabber.hide();

            self.wireMouseEvents($block, $codeGrabber);
            self.wireTooltip($codeGrabber);
            self.wireClick($codeGrabber);
        });
    },

    positionCodeGrabber: function($block, $codeGrabber) {
        var offset = $block.offset();

        var xOffset = offset.left;
        var yOffset = offset.top;

        var grabberOffsetX = xOffset + $block.outerWidth() - 30;
        var grabberOffsetY = yOffset + 5;

        $codeGrabber.css({
            left: grabberOffsetX,
            top: grabberOffsetY
        });
    },

    wireMouseEvents: function($block, $codeGrabber) {
        $block.mouseenter(function(evt) {
            $codeGrabber.show();
        });

        $block.mouseleave(function(evt) {
            $codeGrabber.hide();
        });

        $codeGrabber.mouseenter(function(evt) {
            $(this).show();
            evt.stopPropagation();
        }).mouseleave(function() {
            $(this).hide();
        });
    },

    wireTooltip: function($codeGrabber) {
        $codeGrabber.qtip({
            position: {
                my: "right center",
                at: "left center",
                adjust: {
                    x: -2
                }
            },
            show: {
                delay: 750
            },
            content: {
                text: "Save as Gist"
            },
            style: {
                classes: "qtip-dark qtip-gistbox",
                tip: {
                    width: 6,
                    height: 3
                }
            }
        });
    },

    wireClick: function($codeGrabber) {
        $codeGrabber.unbind("click").click(function() {
            var id = $(this).attr("data-gclp-id");
            var $block = $("pre[data-gclp-id='" + id + "']");

            app.newGistFrame.start({
                url: location.href,
                content: $block.text()
            });
        });
    },

    // utilities
    isBlock: function($pre) {
        if ($pre.find("pre").length !== 0)
            return false;

        // if is less than 100 pixels, we don't treat it as a code block
        if ($pre.outerWidth() < 100)
            return false;

        return true;
    }
});
var app = app || {};

$(function() {
    // do not inject twice
    var $body = $("body");

    if ($body.attr("data-gclp-initialized"))
        return;

    $body.attr("data-gclp-initialized", true);

    // modules
    app.configHelper = new ConfigHelper();

    app.newGistFrame = new NewGistFrame();
    app.pageCodeGrabber = new PageCodeGrabber();
    app.githubGistMenu = new GitHubGistMenu();
});













